    public static int lengthOfLongestSubstring(String s) {

        // iterate through every char
        // for every char get longest substring
        // compare result substring with the current one and replace if needed
        // meanwhile check if you reached max index, if you did then return current substring

        int resultMax = 0;
        int biggestPossibleIndex = s.length();
        for (int i = 0; i < s.length(); i++) {

            char[] array = new char[s.length()];
            int arrayIndex = 0;
            array[arrayIndex] = s.charAt(i);

            int whileIndex = i + 1;
            while (whileIndex < biggestPossibleIndex) {
                char c = s.charAt(whileIndex);
                boolean charDuplicate = isCharDuplicate(c, array);
                if (charDuplicate) {
                    break;
                }

                arrayIndex++;
                array[arrayIndex] = s.charAt(whileIndex);
                whileIndex++;
            }

            resultMax = Math.max(resultMax, arrayIndex + 1);
        }

        return resultMax;
    }

    private static boolean isCharDuplicate(char c, char[] array) {

        for (int i = 0; i < array.length; i++) {
            if (c == array[i]) {
                return true;
            }
        }
        return false;
    }


